#
# Structure for table "prestamo"
#

DROP TABLE IF EXISTS `prestamo`;
CREATE TABLE `prestamo` (
  `IdPrestamo` int(11) NOT NULL AUTO_INCREMENT,
  `IdRegCuenta` int(11) DEFAULT NULL,
  `Fecha` datetime DEFAULT NULL,
  `IdCuentaContable` bigint(12) DEFAULT NULL,
  `Descripcion` varchar(255) DEFAULT NULL,
  `IdCuentaPrestamo` bigint(12) DEFAULT NULL,
  `Saldo` double(15,5) DEFAULT NULL,
  `Fecha de Corte` datetime DEFAULT NULL,
  `TipoPrestamo` varchar(255) DEFAULT NULL,
  `Relevante` int(1) DEFAULT NULL,
  PRIMARY KEY (`IdPrestamo`),
  KEY `prestamo-regcta` (`IdRegCuenta`),
  KEY `prestamo-catalogo` (`IdCuentaContable`),
  CONSTRAINT `prestamo-catalogo` FOREIGN KEY (`IdCuentaContable`) REFERENCES `catalogocuenta` (`idCatalogoCuenta`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `prestamo-regcta` FOREIGN KEY (`IdRegCuenta`) REFERENCES `regcuenta` (`idRegCuenta`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=351 DEFAULT CHARSET=utf8;

